import React from "react";
import { useNavigate } from "react-router-dom";

const Card = (props) => {
  const { todo } = props;
  const { cardClass, cost, name, rarity, text,id} = todo;
  let history = useNavigate();


  return (
    <div
      style={{
        backgroundColor: "grey",
        margin: "10px",
        padding: "15px",
        width: "150px"
      }}
      onClick={() => history.push(`/card/${id}`)}
    >
      <h4> name: {name} </h4>
      <h4> class: {cardClass} </h4>
      <h4> cost: {cost} </h4>
      <h4> rarity: {rarity} </h4>
      <img src = {url}/>
      {/* <h4> text: {text} </h4> */}
      {/* <h6> {`Completed: ${completed}`} </h6> */}
    </div>
  );
};

export default Card;
